import React, { Component } from 'react';
import Child1 from './child1'
class parents extends Component {
    constructor(props){
        super(props)
        this.state={
            stok:10
        }

        buyproduct=(jumlah)=> {
            this.setState({
                stok:this.state.stok-jumlah
            })
        }
    }
    render() {
        return (
            <child1 stock={this.state.stok}
            fungsi={this.buyproduct.bind(this)}/>
        );
    }
}

export default parents;
